import logo from './logo.svg';
import './App.css';
import headshot from './headshot.jpg';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Maja Schermuly's Website
        </p>
      </header>

      <img scr={headshot}/>
    </div>
  );
}

export default App;
